package _1xx

import (
	l "github.com/zhaowk/leetcode_go"
	"testing"
)

func Test_lastSubstring(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{"case 1", args{"abab"}, "bab"},
		{"case 2", args{""}, ""},
		{"case 3", args{l.ReadString("1163.txt")}, ""},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := lastSubstring(tt.args.s); got != tt.want {
				t.Errorf("lastSubstring() = %v, want %v", got, tt.want)
			}
		})
	}
}
